					<h1 class="title-notice">Bộ ảnh "Hà Nội 100 năm trước" đáng kinh ngạc của chàng trai 25 tuổi</h1>
	
					<div class="intro">Das, 25 tuổi, đã dành 7 năm để thực hiện dự án "Hà Nội 100 năm trước" so sánh những địa điểm nổi tiếng của Hà Nội dưới cùng một góc nhìn trước và sau 100 năm vì với anh: “Thời gian là thứ không thể lấy lại được.”</div>
					<div class="content-notice">
						<p>Das - một photographer, designer 25 tuổi, đã dành 7 năm để thực hiện dự án "Hà Nội 100 năm trước". Nhiều người vẫn nghĩ, chắc hẳn đây là một thanh niên sinh ra và lớn lên ở Hà Nội, được nuôi dưỡng bởi thứ tình yêu mộc mạc của mảnh đất nghìn năm, mới có đủ động lực và nhiệt huyết theo đuổi một dự án công phu như thế.</p>

<p>Nhưng không, Das là người miền Nam. Hà Nội chỉ là nơi anh học tập và làm việc, trong suốt 7 năm.</p>

<p>Yêu mến những bức tranh của họa sĩ Bùi Xuân Phái về phố cổ Hà Nội ngày xưa mộc mạc và dung dị, Das đã dành thời gian sưu tầm và khám phá Hà Nội theo cách riêng của mình. Những góc phố cổ, nay đã không còn dấu ấn nhiều nhưng vẫn để lại cho anh nhiều cảm xúc đặc biệt. Từ đó anh bắt đầu thực hiện dự án Hà Nội 100 năm trước và sau, so sánh những địa điểm nổi tiếng của Hà Nội, dưới cùng một góc nhìn nhưng đã có nhiều sự thay đổi khiến người xem không khỏi bồi hồi, nhung nhớ.</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>Quảng trường Đông Kinh Nghĩa Thục.</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>Nhà thờ lớn 100 năm trước chỉ đúng 9h sáng.</p>

<p>Das kể, để bắt đầu, điều đầu tiên anh thực hiện, chắc có lẽ là thức dậy từ 4h sáng.</p>

<p>Những tấm ảnh xưa về Hà Nội đa phần anh sưu tầm trên Internet, tự nghiên cứu và biên tập độc lập. Để biết chính xác địa điểm, anh phải biên dịch tài liệu từ tiếng Pháp sang tiếng Việt. Một số tấm ảnh hiếm, anh mua từ nhiều nguồn khác nhau hoặc phải tải về từ trang nước ngoài rồi vào phần mềm photoshop "độ" lại.</p>

<p>Hầu hết những địa điểm Hà Nội xưa Das đã từng ghé qua, nên khi nhìn vào ảnh xưa cũ, anh đã có chút hình dung đôi nét về khung cảnh đó. Còn việc chụp hình, anh vẫn thường chia sẻ với bạn bè mình rằng "một tấm ảnh đẹp quan trọng là mắt nhìn, còn điện thoại hay máy ảnh chỉ là công cụ".</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>Hướng lên cầu Long Biên.</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>Bưu điện Hà Nội 100 năm trước và năm 2014. Thời xưa mặt chính trông ra đại lộ Francis Garnier (phố Đinh Tiên Hoàng), mặt sau dựa lưng vào phố Chavassieux (phố Lê Thạch).</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>Hồ Gươm 100 năm về trước và 2016.</p>

<p>"Mình luôn cố gắng để bức ảnh xưa và nay khớp nhau nhiều nhất có thể, người xem bởi thế cũng cảm nhận chân thực hơn. Đó là động lực để mình cố gắng", Das nói.</p>

<p>Das muốn mọi người cảm thụ dự án theo hướng nghệ thuật xen chút so sánh hài hước về Hà Nội xưa và nay, chứ không hề vì mục đích lợi nhuận hay chính trị.</p>

<p>Dự án "Hà Nội 100 năm trước" tính đến thời điểm này có tổng cộng 149 bức ảnh và chưa dừng lại. Mỗi địa điểm là công sức góp nhặt rải rác trong vòng 7 năm không liên tục. Das có niềm đam mê với nhiếp ảnh nên việc chụp không khó khăn lắm, mỗi shot hình không ưng ý vẫn có thể quay lại lần nữa để chụp nên tâm tư rất thoải mái.</p>

<p><img src="data:image/jpeg;base64," /></p>

<p>"7 năm dài chứ, nhưng "Hà Nội không vội được đâu". Dự án Hà Nội 100 năm trước chắc đã đi về những đoạn cuối, những bức hình tiếp theo có lẽ sẽ thiên về văn hóa Hà Nội xưa nhiều hơn thay vì địa điểm", Das nói anh không quan trọng chuyện "được" hay "mất" ở đây. Anh nghĩ bản thân được nhiều hơn: được nhìn ngắm góc phố, cảnh vật xưa, được một mình tự do - tự tại nên với anh, không có bất cứ khó khăn nào.</p>

<p>"Đó là tự nguyện, và mình thấy thong thả những nơi mình đi qua. Xuân - Hạ - Thu - Đông, Hà Nội đều có những nét đẹp riêng, có khó khăn chắc là do một số địa điểm xưa đến nay không còn tồn tại nữa, có đi qua mấy lần cũng không thể hình dung ra được".</p>

<p>Một kỉ niệm vui khi chụp chùa Lưu Phương xưa trên góc phố Hàng Bạc giao Hàng Đào, Das có gặp 1 cụ bà bán nước ngay giữa góc phố. Bắt chuyện và hỏi mấy lần nhưng cụ quả quyết ngôi chùa nằm phía dưới đoạn Hàng Ngang, quay đi quay lại rồi lạc mấy vòng trên phố cổ mới hay bà lẫn nên chỉ lung tung.</p>

<p>"Nhưng không thể trách bà được vì địa điểm này đến nay đã không còn tồn tại", Das chia sẻ.</p>

<p>Sau tất cả, Das cảm thấy vui và thoải mái vì đã sắp xếp được "cuộc gặp gỡ" cổ kim giữa hai thời đại cách xa nhau đến hàng trăm năm dù chỉ qua những tấm hình đơn giản. Dự án vì đam mê của bản thân và niềm yêu thích riêng với Hà Nội. Anh hy vọng, mọi người sẽ trân trọng hơn những giá trị xưa cũ, cũng như cảm nhận Hà Nội đẹp hơn, gần gũi hơn qua những bức ảnh.</p>

<p>"Vì thời gian là thứ không thể lấy lại được và lịch sử cũng vậy", Das nói.</p>

